import logo from './logo.svg';
import './App.css';
import ComponentLogined from "./components/componentLogined" 
import BeforeLogin from "./components/beforeLogin"
import Login from  "./components/pages/Login"
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import { BrowserRouter as Router, Switch, Route ,Link} from "react-router-dom";
import { useEffect, useState } from 'react';
import Home from "./components/pages/Home" 
import BeforeSignIn from "./components/beforeSignIn"


function App() {

  return (
    <Router>
        <Route exact path="/" component={() =>  <BeforeLogin />} />
        <Route path="/signIn" component={() =>  <BeforeSignIn />}/>
     </Router>

    );     

}

export default App;
